const SideBar = () => {
    return (
        <nav className='sideBar'>
      <ul className='sideBar__list'> 
        <li>Profile</li>
        <li>Messages</li>
        <li>Frends</li>
        <li>Settings</li>
      </ul>
    </nav>
    )
}
export default SideBar;
